class Usapage extends Component{

  render() {
    return (
      <div className="container-fluid"> 
                     <div className="row">
                          <div className="col-md-12" >
                              <Vatby/>
                           </div>
                      </div>
                      <div className="row">
                           <div className="col-md-2">

                           </div>

                           <div className="col-md-10">
                                   <Usa/>
                           </div>
                      </div>


      </div>  


    )
  }
}

export default Usapage;
